import { CiCircleRemove } from "react-icons/ci";

const Todo = (props) => {
  return (
    <div className="">
      <div className="flex justify-between border p-5 m-5 rounded-full shadow-xl md:w-3/6 md:mx-auto">
        <div className="flex items-center">
          <CiCircleRemove className="text-red-500 mr-5 text-xl cursor-pointer hover:text-pink-800" />
          <p className="text-zinc-500">{props.todo}</p>
        </div>

        <input type="checkbox" className="rounded-full w-10" />
      </div>
    </div>
  );
};

export default Todo;
